import React from 'react';
import './Experience.css';
import { Link } from 'react-router-dom';
import DataLogo from '../assets/DataLogo.png';
import BrightLogo from '../assets/BrightLogo.png';

const Services = () => {
  return (
    <section id="services" className="services">
      <h2>Experience</h2>
      <div className="services-container">
        <div className="service-item">
          <img src={DataLogo} alt="Datalyzer Logo" className="company-logo" />
          <h3>Datalyzer</h3>
          <p>Software Engineer</p>
          <Link to="/datalyzer-details">Learn more</Link>
        </div>
        <div className="service-item">
          <img src={BrightLogo} alt="BrightChamps Logo" className="company-logo" />
          <h3>BrightChamps</h3>
          <p>Coding Instructor</p>
          <Link to="/brightchamps-details">Learn more</Link>
        </div>
      </div>
    </section>
  );
};

export default Services;
